int main () {
    init();
    int cas, bw = 1;
    scanf("%d", &cas);
    for (int kcas = 1; kcas <= cas; kcas++) {
        scanf("%d%d", &N, &M);
        int u = 0;
        while (prime[u] < M) u++;
        int ret = ans[u][N/part];
        int s = N / part * part;

        bw++;
        for (int i = 0; i < C; i++) {
            int l = s / P[i] * P[i];
            while (l < s || l <= P[i]) l += P[i];
            for (int j = l; j <= N; j += P[i])
                vis[j-s] = bw;
        }
        for (int i = max(2, s); i <= N; i++)
            if (vis[i-s] != bw && i != M)
                ret = 1LL * ret * i % M;
        printf("Case #%d: %d\n", kcas, ret);
    }
    return 0;
}
